import { useState, useEffect } from "react";
import { DEFAULTSETTINGS } from "./../utils/Constants";
import "./../App.css";

/*
    Component for settings menu
*/
function Settings() {
    return(
        <div>
            <div className="background">
                <h2 className="sub-header">Settings</h2>
            </div>
        </div>
    );
}

export default Settings;
